import React from 'react';
import classes from './Navbar.module.css';
import Toggle from '../../components/Toggle/Toggle';
class Navbar extends React.Component{
    state={
        toggled: false
    }
    render(){
        return(
            <nav className = {classes.Navbar}>
            
               <Toggle />
                <div>
                    <div>logo</div>
                    <div>search</div>
                </div>
                
                <ul>ul</ul>
            </nav>
        );
    }
}
export default Navbar;
